export default {
  name: 'SelectFlowDialog',
  data() {
    return {
      visible: false,
      flowList: [],
      keyword: ''
    }
  },
  computed: {
    getFlowList() {
      let list = JSON.parse(JSON.stringify(this.flowList)) || []
      if (this.keyword) return list.filter(o => o.fullName.indexOf(this.keyword) !== -1)
      return list
    }
  },
  methods: {
    init(flowList) {
      this.visible = true
      this.flowList = flowList || []
    },
    selectFlow(item) {
      this.$emit('selectFlow', item)
      this.visible = false
    }
  }
}
